 // load flight dataframe from MapR Database 
val df = spark.sparkSession.loadFromMapRDB(tableName, schema)
// show the first 20 rows
df.show
// create a temp view in order to use Spark SQL
spark.conf.set("spark.sql.cbo.enabled", true)
df.createOrReplaceTempView("flights")
spark.catalog.cacheTable("flights")

// notice projection of selected fields [src#26125,dst#26126,depdelay#26129]
// notice PushedFilters: [IsNotNull(src), IsNotNull(depdelay), EqualTo(src,ATL), GreaterThan(depdelay,1.0)]
df.filter("src = 'ATL' and depdelay > 1").groupBy("src", "dst").avg("depdelay").sort(desc("avg(depdelay)")).explain
